import React from "react";

export default function SkillsPage(){
  //change to skillspage
  return (
    <div className="skill-page">
      <h1>Skills</h1>
      <ul>
        <li>These</li>
        <li>Are</li>
        <li>Skills</li>
      </ul>
    </div>
  );
}
